import React from 'react';
import { HomePage } from './pages/HomePage';
import { QuickStartPage } from './pages/QuickStartPage';

function App() {
  const currentPath = window.location.pathname;

  return (
    <div className="App">
      {currentPath === '/quickstart' ? <QuickStartPage /> : <HomePage />}
    </div>
  );
}

export default App;
